vec4 Effect2(vec2 uv) {
    vec2 st = uv - 0.5;
    float r = length(st);

    // Create basic circle shape
    float circle = step(0.4, r);

    // Add rotating prongs using sine waves
    float time = iTime * 0.1;
    float angle = atan2(st.y, st.x) + time;
    float prong1 = sin(angle * 3.0 - time * 2.0) * 0.5 + 0.5;
    float prong2 = sin(angle * 3.0 + time * 2.0) * 0.5 + 0.5;

    // Combine shapes with noise and turbulence
    float noiseVal = noise(vec2(r, angle)) * 0.1;
    float turbulentVal = turbulent(vec2(r, angle)) * 0.3;

    // Create color variations
    vec3 baseColor = hsl(60.0, 1.0, 1.0);
    vec3 accentColor = hsl(0.0, 1.0, 1.0);
    vec3 finalColor = mix(baseColor, accentColor, prong1 * prong2 + noiseVal + turbulentVal);

    // Final composition
    float alpha = smoothstep(0.35, 0.45, r) * (prong1 + prong2 + 0.5);
    return vec4(finalColor, alpha);
}
